import { SocialIcon } from 'react-social-icons';


class Footer extends Component {
  render() {
    return (
    <section className="border">
      <footer className="text-center text-lg-start bg-light text-muted">

        <section className="globalfooter" style={{padding:"0px", border:"0px dashed orange"}}>
          <div className="container text-center text-md-start " 
              style={{height:"200px",border:"0px dashed orange"}}>
            <div className="row mt-3" style={{ border:"1px dashed orange"}}>

              <div className="col-sm-12 col-sm-3 copyrights">
                  &copy; 2019 - GlyGen All rights reserved by 
                  <a href="http://www.uga.edu/" target="_blank">UGA</a>&nbsp;and&nbsp;
                  <a href="https://www.gwu.edu/" target="_blank">GW</a>
              </div>



            </div>
          </div>
      </section>

      <div className="text-left p-4" style={{background: "DodgerBlue", color:"#fff", borderTop:"1px solid #fff"}}>
      </div>
    </footer>
  </section>

    );
  }
}

export default Footer;
